import React, { Component } from 'react';
import './topbar.css';

import titleximg from '../assets/i-large.png';

class topbar extends Component {
  render() {
    return (
      <div className="topbar">

        <div class="top-bar">
           <div class="brand">
             <img src={titleximg} width="157" />
           </div>

           <div class="buttons">
             <div class="item">
              Companies</div>
              <div class="item b-item">
               Angels </div>
               <div class="item b-item">
               Sharktank </div>
               <div class="item b-item">
               Crowdfund </div>
               <div class="item b-item">
               Courselab </div>
               <div class="item b-item">
               Remote </div>

             </div>
           <span class="none">Companies, Angels, Sharktank, 2.0Courselab, 3.0Remote (U.S Only)</span>
           <span class="none"> Loader: Charcoal Background on Large-Logo - Fadein </span>
        </div>

      </div>
    );
  }
}

export default topbar;
